        "脊迴歸、LASSO迴歸與彈性網罩懲罰模型\n",
        "OLS所估計的線性迴歸模型係數，是所有迴歸係數不偏估計式中變異數最小的，也就是這些係數估計式是數理統計學中定義的最小變異不偏點估計式（ＭＶＵＥ）。\n",
        "當預測變數大於樣本變數個數時，或是預測變數間相關性高，亦即存在著共線性的問題時，OLS的估計解因為變異數大而不穩定，因此使用MSE，因為MSE的期望值可以分解為不可縮減的噪訊項、模型偏誤的平方項、模型變異等三項。\n",
        "OLS當模型過度適配訓練資料時，OLS係數估計值就會膨脹，我們透過估計（參數優化）過程控制係數估計值的大小，以降低SSE，這種過程稱係數正規化。\n",
        "適當的增加估計式的偏誤，以降低變異的具體做法，就是對OLS的目標函數SSE加上各迴歸係數所產生的懲罰項。懲罰向的效果是如果迴歸係數可讓SSE明顯降低，係數估計值被容許增大。因此當懲罰項逐漸增大時，會將不重要的變數估計值依序縮減到零，所以這種配適技術又稱為係數縮減法。\n",
        "\n"
      ],
      "metadata": {
        "id": "jVCxDtKxrPoR"
      }
    },
    {
